function Notification(props) {
  console.log(props)
    return (
        <nav className={props.openNotification ? 'notification-menu active' : 'notification-menu'}>
          <h2 class='notificationheading'>Notifications</h2>
          <h2 class='notificationsubheading'><Link>Mark as read</Link></h2>
          {NotificationData.map((item, index) => {
              return (
                <Card style={{height:'120px',background:'#aeb9f7'}}>
                  <span>{item.text}</span>
                </Card>

              )
            })}
        </nav>
    )
}

export default Notification;
